  min-height:80vh;
  background-color:#24305e;
  padding:30px;
  font-family: 'Anton', sans-serif;
`
const Title = styled.h2`
    color:white;
    width:100%;
    padding:0;
    margin:0;
`;
export default function PreviousPlaylists() {
    return (
        <Wrapper>
            <Title>Archive</Title>
            <OldPlaylistCard Chapter={"Chapter 005"}/>
            <OldPlaylistCard Chapter={"Chapter 006"}/>

        </Wrapper>
    )
}
